// output : 
// create an array of the same size merging the two arrays.
// if both values are 0, keep 0
// values other than zero from the collision array should be 1
// values other than zero from the waterCollision array should be 2

const output = [];
for (let i = 0; i < collisions.length; i++) {
    if (collisions[i] === 0 && waterCollision[i] === 0) {
        output.push(0);
    } else if (collisions[i] !== 0) {
        output.push(1);
    } else if (waterCollision[i] !== 0) {
        output.push(2);
    } else {
        output.push(0);
    }
}

console.log(output);
// write output to a file as an array of numbers
import { writeFileSync } from 'fs';
writeFileSync('output.json', JSON.stringify(output));

